const CSGOLSThree = () => {
  const csgoStashLink = 'https://csgostash.com';

  const redirectToCSGOStash = () => {
    window.open(csgoStashLink, '_blank');
  };

  return (
    <section id="learn" className="bg-dark text-light p-5">
      <div className="container">
        <div className="row align-items-center justify-content-between">
          <div className="col-md">
            <img src={require("../images/KnifeCS.webp")} className="img-fluid" alt="" />
          </div>

          <div className="col-md">
            <h2>Shop Changes of the Week/Season</h2>
            <p>In the bustling virtual marketplace of Counter-Strike: Global Offensive skins, the local skin market has recently experienced a fascinating ebb and flow, particularly concerning the coveted knife patterns. Enthusiasts have observed a surge in demand for intricately crafted patterns, such as the elusive "Damascus Steel" and the mesmerizing "Tiger Tooth." These patterns, renowned for their visual appeal and rarity, have seen a notable uptick in prices as collectors vie for these unique and limited-edition designs.</p>
            <button
              className="btn btn-light mt-3"
              onClick={redirectToCSGOStash}
            >
              Visit the Shop
            </button>
          </div>
        </div>
      </div>
    </section>
  );
};

export default CSGOLSThree;
